import React, { Component, useState, useEffect } from "react";
import axios from "axios";
import { useParams } from "react-router-dom"

function ArticleDetail() {
    // const {mabaiviet}=useParams();
    let mabaiviet= 1;
    const [posts, setPosts] = useState([]);
    let url="https://localhost:5001/baiviet/"+mabaiviet;
    console.log(url)
    useEffect(() => {
        axios.get(`https://localhost:5001/baiviet/${mabaiviet}`)
            .then(res => {
                console.log(res);
                setPosts(res.data);
            })
            .catch(err => {
                console.log(err)
            })
    }, [])
    return (
        <div>
            {
                posts.map(post => (
                    <p>{post.mabaiviet}</p>
                ))
            }
        </div>
    );
}

export default ArticleDetail;
